import React from "react";

const FilteredView = (props) => {
  const { items } = props;

  const tableRows = items.map((item, i) => {
    return (
      <tr>
        <td>{item.type}</td>
        <td>{item.place}</td>
        <td>{item.date}</td>
        <td>{item.amount}</td>
      </tr>
    );
  });

  return (
    <table>
      <tbody>{tableRows}</tbody>
    </table>
  );
};

export default FilteredView;
